- TextSection:
  - Contents: Williams syndrome is a rare genetic multisystemic neurodevelopmental
      disorder characterized by a distinct facial appearance, cardiac anomalies (most
      frequently supravalvular aortic stenosis), cognitive and developmental abnormalities,
      and connective tissue abnormalities (such as joint laxity)
    Name:
